import React from "react";

const Card = () => {
  return (
    <div className="col mb-5">
      <div className="card" style={{ width: "18rem" }}>
        <img
          src="https://media.diariouno.com.ar/p/78da26176812d47341b4614ee85ef68a/adjuntos/298/imagenes/009/226/0009226392/1200x0/smart/pityjpg.jpg"
          className="card-img-top"
          alt="placeholder"
        ></img>
      </div>
    </div>
  );
};

export default Card;
